CREATE EXTENSION IF NOT EXISTS postgis;

-- Create the 'capture' schema if it does not exist
CREATE SCHEMA IF NOT EXISTS capture;

ALTER SCHEMA capture OWNER TO postgres;

-- Create the table 'waterservices_daily' if it does not exist
CREATE TABLE IF NOT EXISTS capture.waterservices_daily (
    id UUID PRIMARY KEY,
    timeseries_id UUID NOT NULL,
    monitoring_location_id VARCHAR(50) NOT NULL,
    parameter_code VARCHAR(50) NOT NULL,
    statistic_id VARCHAR(50),
    "time" DATE NOT NULL,
    value FLOAT NOT NULL,
    unit_of_measure VARCHAR(50),
    approval_status VARCHAR(50),
    qualifier VARCHAR(50),
    last_modified TIMESTAMP NOT NULL,
    geometry GEOMETRY(POINT, 4326)
);

